let lbmModel=(()=>{return{getUser:function(){return{sex:document.querySelector('input[name="sexes"]:checked'),height:document.getElementById("height"),wrist:document.getElementById("wrist"),ankle:document.getElementById("ankle"),fat:document.getElementById("desired-fat"),lbm:document.getElementById("lbm-kg"),lbmLowerBound:document.getElementById("lbm-kg-lowerbound"),lbmHigherBound:document.getElementById("lbm-kg-higherbound"),weightLowerBound:document.getElementById("overall-lowerbound"),weightHigherBound:document.getElementById("overall-higherbound")}},heightRelativeLBM:function(e,t,n){return e*t-n},heightRelativeWrist:function(e,t,n){return e*t+n},heightRelativeAnkle:function(e,t,n){return e*t+n},wristLbm:function(e,t,n){return Math.cbrt((Math.pow(e,2)-Math.pow(t,2))/Math.pow(e,2)*Math.pow(n,3)+Math.pow(n,3))},ankleLbm:function(e,t,n){return Math.cbrt((Math.pow(e,2)-Math.pow(t,2))/Math.pow(e,2)*Math.pow(n,3)+Math.pow(n,3))},fatPercentBodyWeight:function(e,t){return t/(1-e/100)}}})();